        "homeStatement": MessageLookupByLibrary.simpleMessage(
            "Only here, can you consume Made in Italy luxury products with the comfort and ease of a billionaire, regardless of your income or social status!\n\nDear Visitor,\n\nExplore exquisite collections from over 200 talented designer brands from Italy, France, Spain, and all over Europe. At Vetrina Mia, we exclusively bring these unique and luxurious creations to the Asia-Pacific market, including China.\n\nAll of the fashion products created by each brand are meticulously crafted by experienced Italian artisans who have spent generations making high-end products for the world’s top-tier luxury brands.\n\nAt Vetrina Mia, we believe that the right to enjoy fashion belongs to everyone, regardless of wealth or status. Fashion is a beautifully designed and meticulously crafted artistic creation that everyone should be able to enjoy as a testament to human ingenuity.\n\nShowroom:\n\n• Location: Our inaugural showroom is located at Shop T6-105, Changning International, 1398 Kaixuan Road, Changning District, Shanghai, China.\n\nFrom 1 August, you will be able to sign up and indicate your products of interest, and without making any pre-payment queue to purchase when the product becomes available.\n\nFrom 1 September, we will kick off our online retail sales, all sales will be through our platform and mobile app.\n\nDue to the lengthy crafting process by the artisans, there may be waiting times, or some delays or even situations where the products are unavailable, for which we apologise. The best you can do is to queue early. If you do not want to wait, you can cancel your order at any time. We operate on a first-come, first-served basis.\n\nPurchasing Conditions:\n\n• Brand Membership: Each brand has its own membership.\n• Free Trial: Membership is complimentary for the first three months after you make your first purchase from each brand.\nMembership Benefits: Prices and services differ for non-members and members. As a member, you will enjoy at least a 40% discount. Initially, we will launch the bag series, followed by clothing, shoes, children\'s wear, etc.\n• Sponsorship Fee: After three months from the first purchase, you can continue enjoying membership benefits for a small sponsorship fee of 10 RMB per brand per month, the cost of an espresso. Of course, You can also sponsor a bigger amount to support your favorite brands and their operations.\n• Flexible Membership: Membership is charged every 3 months, but you can cancel at any time without any conditions. We reserve the right to deny rejoining.\n\nWe greatly appreciate your understanding and patience during our launch period. We may encounter some service errors or issues, but we will strive to bring you a diverse and enchanting fashion experience and warm and thoughtful service.\n\nEvery member is always part of the Vetrina Mia family, and your thoughts and opinions are always our motivation for improvement."),
